// ==UserScript==
// @name           [ITS] CRM fixes
// @description    In Chrome you only have to hit return once to log in. Also, closing a tab doesn't log you out.
// @namespace      http://its.uah.edu/tag
// @author         Hunter Fuller (hf0002@uah.edu)
// @license        GNU GPL v3 (http://www.gnu.org/copyleft/gpl.html) 
// @homepage       http://its.uah.edu/tag
// @version        1
// @include        https://crm.uah.edu/Scripts/texcel/ServiceWise/Servicewise.dll*
// @include		   https://crm.uah.edu/Scripts/texcel/ServiceWise/servicewise.dll*	
// @include		   https://crm.uah.edu/scripts/texcel/servicewise/servicewise.dll*
//
// @require        https://ajax.googleapis.com/ajax/libs/jquery/1.6.0/jquery.min.js
//
// @version		   6
// @history        6 Fixed bug where the reminder would appear outside of the login screen
// @history		   5 Firefox support (for Kristina :D)
// @history		   4 Added another include to fix script not working for QuickEdit links in email notifications
// @history		   3 Added cleanup features to the login page, as well as script reminder
// @history		   2 Added CRM tab-close logout workaround
// @history        1 first test version
//
// ==/UserScript==


//login fix
var form = document.getElementsByName("form1")[0];
if ( form != null && document.getElementsByName("Password").length > 0 ) {
	//we are on the login page.
	
	//page mods
	document.getElementsByTagName("img")[0].height = "300";
	document.getElementsByTagName("img")[0].width  = "300";
	document.getElementsByTagName("img")[2].style.opacity = "0.5";
	//reminder
	document.getElementsByTagName("a")[0].outerHTML = "You are using Hunter Fuller's CRM script.<br/>Closing tabs will not log you out.";
	
	form.action = "servicewise.dll?Login";
	form.addEventListener('submit', function(event)
	{
		event.preventDefault();
		
		document.getElementsByName("form1")[0].Username.value = document.getElementsByName("form0")[0].Username.value;
		document.getElementsByName("form1")[0].method = "post";
		document.getElementsByTagName("img")[0].src = "data:image/gif;base64,";
		setTimeout( function(){
			document.getElementsByName("form1")[0].submit();
			document.getElementsByName("form0")[0].Username.disabled = true;
			document.getElementsByName("form1")[0].Password.disabled = true;
		},1);
		
		return false;
		
	}, false);
}

//don't log me out on tab close
var frameset = document.getElementsByTagName("frameset")[0];
if ( frameset != null ) {
	frameset.onbeforeunload = null;
}

